PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE bd_bModel_master_Categories (
  ID NVARCHAR(36) NOT NULL,
  createdAt TIMESTAMP_TEXT,
  createdBy NVARCHAR(255),
  modifiedAt TIMESTAMP_TEXT,
  modifiedBy NVARCHAR(255),
  CategoryName NVARCHAR(100) NOT NULL,
  Description NVARCHAR(255),
  PRIMARY KEY(ID)
);
CREATE TABLE bd_bModel_master_Products (
  ID NVARCHAR(36) NOT NULL,
  createdAt TIMESTAMP_TEXT,
  createdBy NVARCHAR(255),
  modifiedAt TIMESTAMP_TEXT,
  modifiedBy NVARCHAR(255),
  CategoryID INTEGER,
  SupplierID INTEGER,
  ProductName NVARCHAR(100) NOT NULL,
  supplier_ID NVARCHAR(36),
  category_ID NVARCHAR(36),
  QuantityPerUnit NVARCHAR(100),
  UnitPrice DECIMAL(15, 2),
  UnitsInStock INTEGER,
  UnitsOnOrder INTEGER,
  ReorderLevel INTEGER,
  Discontinued BOOLEAN,
  PRIMARY KEY(ID)
);
CREATE TABLE bd_bModel_transactional_OrderDetails (
  createdAt TIMESTAMP_TEXT,
  createdBy NVARCHAR(255),
  modifiedAt TIMESTAMP_TEXT,
  modifiedBy NVARCHAR(255),
  order_ID NVARCHAR(36),
  product_ID NVARCHAR(36),
  UnitPrice DECIMAL(15, 2),
  Quantity INTEGER,
  Discount DECIMAL(5, 2)
);
CREATE TABLE bd_bModel_transactional_Orders (
  ID NVARCHAR(36) NOT NULL,
  createdAt TIMESTAMP_TEXT,
  createdBy NVARCHAR(255),
  modifiedAt TIMESTAMP_TEXT,
  modifiedBy NVARCHAR(255),
  OrderID INTEGER,
  CustomerID NVARCHAR(255),
  EmployeeID INTEGER,
  ShipVia INTEGER,
  customer_ID NVARCHAR(36),
  employee_ID NVARCHAR(36),
  shipper_ID NVARCHAR(36),
  OrderDate DATETIME_TEXT NOT NULL,
  RequiredDate DATETIME_TEXT,
  ShippedDate DATETIME_TEXT,
  Freight DECIMAL(15, 2),
  ShipName NVARCHAR(200),
  ShipAddress NVARCHAR(200),
  ShipCity NVARCHAR(100),
  ShipPostalCode NVARCHAR(20),
  ShipCountry NVARCHAR(100),
  PRIMARY KEY(ID)
);
CREATE TABLE bd_bModel_master_Customers (
  ID NVARCHAR(36) NOT NULL,
  createdAt TIMESTAMP_TEXT,
  createdBy NVARCHAR(255),
  modifiedAt TIMESTAMP_TEXT,
  modifiedBy NVARCHAR(255),
  CustomerID INTEGER,
  CompanyName NVARCHAR(100) NOT NULL,
  ContactName NVARCHAR(100),
  ContactTitle NVARCHAR(100),
  Address NVARCHAR(250),
  City NVARCHAR(100),
  Country NVARCHAR(100),
  PostalCode NVARCHAR(20),
  Phone NVARCHAR(20),
  Fax NVARCHAR(50),
  PRIMARY KEY(ID)
);
CREATE TABLE bd_bModel_master_Employees (
  ID NVARCHAR(36) NOT NULL,
  createdAt TIMESTAMP_TEXT,
  createdBy NVARCHAR(255),
  modifiedAt TIMESTAMP_TEXT,
  modifiedBy NVARCHAR(255),
  EmployeeID INTEGER,
  reportsTo_ID NVARCHAR(36),
  territory_ID NVARCHAR(36),
  LastName NVARCHAR(100),
  FirstName NVARCHAR(100),
  Title NVARCHAR(100),
  TitleOfCourtesy NVARCHAR(50),
  BirthDate DATETIME_TEXT NOT NULL,
  HireDate DATETIME_TEXT NOT NULL,
  Address NVARCHAR(200),
  City NVARCHAR(100),
  PostalCode NVARCHAR(20),
  Country NVARCHAR(100),
  HomePhone NVARCHAR(50),
  Extension NVARCHAR(20),
  Notes NVARCHAR(255),
  PRIMARY KEY(ID)
);
CREATE TABLE bd_bModel_master_Territories (
  ID NVARCHAR(36) NOT NULL,
  TerritoryID INTEGER,
  RegionID INTEGER,
  region_ID NVARCHAR(36),
  Description NVARCHAR(250) NOT NULL,
  PRIMARY KEY(ID)
);
CREATE TABLE bd_bModel_master_Regions (
  ID NVARCHAR(36) NOT NULL,
  RegionID INTEGER,
  Description NVARCHAR(250) NOT NULL,
  PRIMARY KEY(ID)
);
CREATE TABLE bd_bModel_master_Shippers (
  ID NVARCHAR(36) NOT NULL,
  createdAt TIMESTAMP_TEXT,
  createdBy NVARCHAR(255),
  modifiedAt TIMESTAMP_TEXT,
  modifiedBy NVARCHAR(255),
  ShipperID INTEGER,
  CompanyName NVARCHAR(100) NOT NULL,
  Phone NVARCHAR(20) DEFAULT '9099973246',
  PRIMARY KEY(ID)
);
CREATE TABLE bd_bModel_master_Suppliers (
  ID NVARCHAR(36) NOT NULL,
  createdAt TIMESTAMP_TEXT,
  createdBy NVARCHAR(255),
  modifiedAt TIMESTAMP_TEXT,
  modifiedBy NVARCHAR(255),
  CompanyName NVARCHAR(100) NOT NULL,
  ContactName NVARCHAR(100) NOT NULL,
  ContactTitle NVARCHAR(100),
  Address NVARCHAR(250),
  City NVARCHAR(100),
  PostalCode NVARCHAR(20),
  Country NVARCHAR(100),
  Phone NVARCHAR(50),
  Fax NVARCHAR(50),
  Website NVARCHAR(100) DEFAULT 'www.notexist.com',
  PRIMARY KEY(ID)
);
CREATE TABLE cds_outbox_Messages (
  ID NVARCHAR(36) NOT NULL,
  timestamp TIMESTAMP_TEXT,
  target NVARCHAR(255),
  msg NCLOB,
  attempts INTEGER DEFAULT 0,
  "partition" INTEGER DEFAULT 0,
  lastError NCLOB,
  lastAttemptTimestamp TIMESTAMP_TEXT,
  status NVARCHAR(23),
  PRIMARY KEY(ID)
);
CREATE VIEW CatalogService_Categories AS SELECT
  Categories_0.ID,
  Categories_0.CategoryName,
  Categories_0.Description
FROM bd_bModel_master_Categories AS Categories_0;
COMMIT;
